import React from 'react'

export default function SortableList() {
    const [tasks, setTasks] = useState([
        {id: 1, title: 'task 1', order: 1},
        {id: 2, title: 'task 2', order: 1},
    ])

    return (
    tasks.map(task => <h1 className='title'>{task.title}</h1>)
    )
}
